import React from "react";

const NoteItems=(props)=>{


return(
    <>
    <div class=" my-3 mx-3 card text-center" style={{maxWidth:'450px', display:'grid', gridTemplateColumns:'1fr 1fr'}}>
    <h4 class="card-header">
      {props.title}
    </h4>
    <div class="card-body">
      
      <p class="card-text">{props.description}</p>
    </div>
    <div class="card-footer text-body-secondary">
      {props.date}
    </div>
      <div> 
      <p class="card-text" style={{fontSize:'13px'}}><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-bookmark" viewBox="0 0 16 16">
  <path d="M2 2a2 2 0 0 1 2-2h8a2 2 0 0 1 2 2v13.5a.5.5 0 0 1-.777.416L8 13.101l-5.223 2.815A.5.5 0 0 1 2 15.5zm2-1a1 1 0 0 0-1 1v12.566l4.723-2.482a.5.5 0 0 1 .554 0L13 14.566V2a1 1 0 0 0-1-1z"/>
</svg>{props.tag}</p>
        <a href="#" class="btn btn-primary mb-2">Go somewhere</a>
        </div>
  </div>
    
    </>


);


}


export default NoteItems;
